import React from 'react';
import { Outlet, Link } from 'react-router-dom'
import './App.css'

function App() {
  return (
    <div>
      <header>
        <h1>SebMedia</h1>
        <Link to="home">Home</Link>
        <Link to="dashboard">Dashboard</Link>
        <Link to="posts">Posts</Link>
      </header>
      <Outlet/>
    </div>
  );
}

export default App;
